import React from "react";
import Navbar from "./Navbar";
import "./contact.css";

// Import the image
import featuredImage from "/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/12.jpg"; 

const Contact = () => {
    return (
      <div className="contact-hero">
        <Navbar/>
        <div className="contact-hero-left">
          <p className="contact-number">Lets connect .</p>
          <h1 className="contact-title">Contact.</h1>
          <div className="contact-details">
            <p>
              <strong>Curated by:</strong> Deepa Devangmath
            </p>
            <p>
              <strong>Featured Image:</strong> Photography by Deepa
            </p>
            <p>
              <strong>Last updated:</strong> 2 days ago
            </p>
          </div>
          <p className="contact-cta">Drop me a message.</p>
        </div>

        <div className="contact-hero-right">
          <div className="contact-featured">
            <img
              src={featuredImage}
              alt="Contact Featured"
              className="contact-featured-image"
            />
          </div>

        </div>
      </div>
    );
  };

  export default Contact;
